import React, { useState } from 'react';
import { Button } from './ui/Button';

const TradeForm = ({ onAddTrade, onCancel }) => {
    const [trade, setTrade] = useState({
        ticker: '',
        tipo: 'Compra',
        data_entrada: '',
        preco_entrada: '',
        data_saida: '',
        preco_saida: '',
        quantidade: '',
        setup: '',
        observacoes: ''
    });

    const [loading, setLoading] = useState(false);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setTrade(prev => ({ ...prev, [name]: value }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);

        try {
            await onAddTrade(trade);
            setTrade({
                ticker: '', tipo: 'Compra', data_entrada: '', preco_entrada: '',
                data_saida: '', preco_saida: '', quantidade: '', setup: '', observacoes: ''
            });
        } catch (error) {
            console.error('Erro ao criar trade:', error);
        } finally {
            setLoading(false);
        }
    };

    return (
        <form onSubmit={handleSubmit} className="space-y-4">
            <div className="grid grid-cols-2 gap-4">
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Ticker *
                    </label>
                    <input 
                        name="ticker" 
                        value={trade.ticker} 
                        onChange={handleChange} 
                        placeholder="Ex: PETR4"
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        required 
                    />
                </div>
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Tipo *
                    </label>
                    <select 
                        name="tipo" 
                        value={trade.tipo} 
                        onChange={handleChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                    >
                        <option value="Compra">Compra</option>
                        <option value="Venda">Venda</option>
                    </select>
                </div>
            </div>

            <div className="grid grid-cols-2 gap-4">
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Data de Entrada *
                    </label>
                    <input 
                        type="date" 
                        name="data_entrada" 
                        value={trade.data_entrada} 
                        onChange={handleChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        required 
                    />
                </div>
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Preço de Entrada *
                    </label>
                    <input 
                        type="number" 
                        step="0.01"
                        name="preco_entrada" 
                        value={trade.preco_entrada} 
                        onChange={handleChange} 
                        placeholder="0.00"
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                        required 
                    />
                </div>
            </div>

            <div className="grid grid-cols-2 gap-4">
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Data de Saída
                    </label>
                    <input 
                        type="date" 
                        name="data_saida" 
                        value={trade.data_saida} 
                        onChange={handleChange}
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                    />
                </div>
                <div>
                    <label className="block text-sm font-medium text-gray-700 mb-1">
                        Preço de Saída
                    </label>
                    <input 
                        type="number" 
                        step="0.01"
                        name="preco_saida" 
                        value={trade.preco_saida} 
                        onChange={handleChange} 
                        placeholder="0.00"
                        className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                    />
                </div>
            </div>

            <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                    Quantidade *
                </label>
                <input 
                    type="number" 
                    name="quantidade" 
                    value={trade.quantidade} 
                    onChange={handleChange} 
                    placeholder="100"
                    className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                    required 
                />
            </div>

            <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                    Setup
                </label>
                <input 
                    name="setup" 
                    value={trade.setup} 
                    onChange={handleChange} 
                    placeholder="Ex: Rompimento de resistência"
                    className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                />
            </div>

            <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                    Observações
                </label>
                <textarea 
                    name="observacoes" 
                    value={trade.observacoes} 
                    onChange={handleChange} 
                    placeholder="Adicione suas observações sobre o trade..."
                    rows="3"
                    className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-blue-500"
                />
            </div>

            <div className="flex gap-3 pt-4">
                <Button 
                    type="submit" 
                    className="flex-1"
                    disabled={loading}
                >
                    {loading ? 'Salvando...' : 'Salvar Trade'}
                </Button>
                <Button 
                    type="button" 
                    variant="outline" 
                    onClick={onCancel}
                    className="flex-1"
                >
                    Cancelar
                </Button>
            </div>
        </form>
    );
};

export default TradeForm;
